        nPension      :string;
        nom           :string;
        prenom        :string;
        cin           :string;
        adresse       :string;
        ville         :string;
        codePostale   :string;
        dateNaissance :Date;
        sexe          :string;
        telephone     :string;
        telephone2    :string;

        Qps            :IQp[];
