  export interface IQp {

    nDossier          :number;
    datePaiementTech  :Date;
    datePaiementReel  :Date;
    fraisEngage       :number;
    rembAmo           :number;
    rembMpsc          :number;
    totalRemb         :number;
    observation       :string;
    codeEchance       :number;
  }
  export interface ICumuleQp {

    id :number;
    cin :string;
    montant :number;
    observation :string;
    idUser :string;
    dateAffectation :Date;
  }
  export interface IQpMois {

    idPai :number;
    cinQp :string;
    date :Date;
    qp :number;
    rcar :string;
    typePai :number;
    codeEchanceQpMois :number;
    code303 :number;
    code304 :number;
    idUser :string;
    dateSaisie :Date;
    observation :string;
    cinPaiement :string;

  }

  export interface IAvanceCheques {
   IdAvanceCheque :number;
   CinAv :string;
   MontantAv :number;
   DateAvance :Date;
   UserAvance :string;
   DateSaisie :Date;
